import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Dashboard from "./components/User/Dashboard";
import Notifications from "./components/User/Notifications";
import Calendar from "./components/User/Calendar";
import FrequencyReport from "./components/Reporting/FrequencyReport";
import OverdueTrends from "./components/Reporting/OverdueTrends";
import CompanyManagement from "./components/Admin/CompanyManagement";
import CommunicationMethod from "./components/Admin/CommunicationMethod";

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <a href="/">Dashboard</a>
          <a href="/notifications">Notifications</a>
          <a href="/calendar">Calendar</a>
          <a href="/reports/frequency">Frequency Report</a>
          <a href="/reports/overdue-trends">Overdue Trends</a>
          <a href="/admin/companies">Manage Companies</a>
          <a href="/admin/methods">Manage Methods</a>
        </nav>
        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/notifications" element={<Notifications />} />
          <Route path="/calendar" element={<Calendar />} />
          <Route path="/reports/frequency" element={<FrequencyReport />} />
          <Route path="/reports/overdue-trends" element={<OverdueTrends />} />
          <Route path="/admin/companies" element={<CompanyManagement />} />
          <Route path="/admin/methods" element={<CommunicationMethod />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
